import React from 'react';

export default function Warranty() {
  const data = [
    {
      item: "Motor System",
      parts: ["Linear Actuator", "Driving Motor"],
      warranty: "2 Years",
    },
    {
      item: "Power System",
      parts: ["Lithium-ion Battery", "Power Adapter", "Docking Station"],
      warranty: "2 Years",
    },
    {
      item: "Electric Control System",
      parts: ["RTK System", "Motherboard"],
      warranty: "2 Years",
    },
    {
      item: "Sensor",
      parts: ["Camera", "Millimeter-wave Radar"],
      warranty: "2 Years",
    },
    {
      item: "Consumables",
      parts: ["Shell", "Tracks", "Lubricants"],
      warranty: ["1 Year", "1 Year", "No Warranty"],
    },
  ];

  return (
    <div className="overflow-x-auto">
      <table className="w-full border-collapse border border-gray-500">
        <thead>
          <tr className="bg-black text-white">
            <th className="border border-gray-500 px-4 py-2">Item</th>
            <th className="border border-gray-500 px-4 py-2">Parts</th>
            <th className="border border-gray-500 px-4 py-2">Warranty</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              <td className="border border-gray-500 px-4 py-2">{row.item}</td>
              <td className="border border-gray-500 px-4 py-2">
                <ul>
                  {row.parts.map((part, partIndex) => (
                    <li key={partIndex}>{part}</li>
                  ))}
                </ul>
              </td>
              <td className="border border-gray-500 px-4 py-2">
                {Array.isArray(row.warranty) ? (
                  <ul>
                    {row.warranty.map((warranty, warrantyIndex) => (
                      <li key={warrantyIndex}>{warranty}</li>
                    ))}
                  </ul>
                ) : (
                  row.warranty
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
